import React from "react";
import "./Header.css";

function Header() {
  return (
    <div className="header">
      <nav>
        <img
          className="header_logo"
          src="https://www.pngitem.com/pimgs/m/117-1170427_hospital-logo-red-cross-hd-png-download.png"
        />
      </nav>
    </div>
  );
}

export default Header;
